import React, { useState } from 'react';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import { Box } from '@mui/material';

function Configuration() {
  const [apiKey, setApiKey] = useState('');
  const [userId, setUserId] = useState('');
  const [businessId, setBusinessId] = useState('');
  const [configOutput, setConfigOutput] = useState('');

  const handleSaveConfig = () => {
    // Save configuration logic here (replace with your actual logic)
    setConfigOutput(`Configuration Saved:\nAPI Key: ${apiKey}\nUser ID: ${userId}\nBusiness ID: ${businessId}`);
  };

  return (
    <Card>
      <CardContent>
        <Typography variant="h6" gutterBottom>Configuration</Typography>
        <Box sx={{ '& > :not(style)': { m: 1, width: '25ch' } }}>
          <TextField label="API Key" variant="outlined" value={apiKey} onChange={(e) => setApiKey(e.target.value)} />
          <TextField label="User ID" variant="outlined" value={userId} onChange={(e) => setUserId(e.target.value)} />
          <TextField label="Business ID" variant="outlined" value={businessId} onChange={(e) => setBusinessId(e.target.value)} />
          <Button variant="contained" onClick={handleSaveConfig}>Save Config</Button>
          <Typography variant="body1">{configOutput}</Typography>
        </Box>
      </CardContent>
    </Card>
  );
}

export default Configuration;
